                self.fun,
                x0.flatten(),
                method="trust-constr",
                jac=self.jac,
                hess=self.hess,
                options={"disp": True},
            )
        except Exception as e:
            res = scipy.optimize.OptimizeResult()
            res["execution_time"] = np.nan
            res["message"] = str(e)
            res["success"] = False
            res["x"] = x0.flatten()
            return res
